// src/register.js
import React, { useState } from "react";
import "./register.css";
import { sendCode, verifyCode, signup } from "./authApi";
import { useNavigate } from "react-router-dom";

function Register() {
  const navigate = useNavigate();

  // ------------------------------------
  // 1. ÏÉÅÌÉú(state)
  // ------------------------------------
  const [form, setForm] = useState({
    user_id: "",
    user_name: "",
    user_nickname: "",
    email: "",
    password: "",
  });

  const [code, setCode] = useState("");
  const [isCodeSent, setIsCodeSent] = useState(false);
  const [isVerified, setIsVerified] = useState(false);

  // ------------------------------------
  // 2. ÏûÖÎ†•Í∞í Î≥ÄÍ≤Ω
  // ------------------------------------
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  // ------------------------------------
  // 3. Ïù¥Î©îÏùº Ïù∏Ï¶ùÎ≤àÌò∏ Î∞úÏÜ°
  // ------------------------------------
  const handleSendCode = async () => {
    if (!form.email) {
      alert("Ïù¥Î©îÏùºÏùÑ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    try {
      const res = await sendCode(form.email);
      alert(res.message || "Ïù∏Ï¶ùÏΩîÎìúÎ•º Ï†ÑÏÜ°ÌñàÏäµÎãàÎã§.");
      setIsCodeSent(true); // ‚úÖ Ïó¨Í∏∞ÏÑú true ‚Üí ÏïÑÎûò Ïù∏Ï¶ùÎ≤àÌò∏ ÏûÖÎ†•Ïπ∏ Î≥¥ÏûÑ
      setIsVerified(false);
    } catch (err) {
      console.error(err);
      alert(err.message || "Ïù∏Ï¶ùÏΩîÎìú Ï†ÑÏÜ° Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.");
    }
  };

  // ------------------------------------
  // 4. Ïù∏Ï¶ùÎ≤àÌò∏ ÌôïÏù∏
  // ------------------------------------
  const handleVerifyCode = async () => {
    if (!code) {
      alert("Ïù∏Ï¶ùÎ≤àÌò∏Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    try {
      const res = await verifyCode(form.email, code);
      alert(res.message || "Ïù∏Ï¶ù Í≤∞Í≥ºÎ•º ÌôïÏù∏ÌñàÏäµÎãàÎã§.");
      setIsVerified(!!res.ok);
    } catch (err) {
      console.error(err);
      alert(err.message || "Ïù∏Ï¶ùÎ≤àÌò∏ Í≤ÄÏ¶ù Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.");
      setIsVerified(false);
    }
  };

  // ------------------------------------
  // 5. ÌöåÏõêÍ∞ÄÏûÖ
  // ------------------------------------
  const handleSignup = async () => {
    if (!isVerified) {
      alert("Ïù¥Î©îÏùº Ïù∏Ï¶ùÏù¥ ÏôÑÎ£åÎêòÏñ¥Ïïº ÌöåÏõêÍ∞ÄÏûÖÏù¥ Í∞ÄÎä•Ìï©ÎãàÎã§.");
      return;
    }

    if (!form.user_id || !form.user_name || !form.user_nickname || !form.password) {
      alert("Ïù¥Î¶Ñ, ÏïÑÏù¥Îîî, ÎπÑÎ∞ÄÎ≤àÌò∏, ÎãâÎÑ§ÏûÑÏùÑ Î™®Îëê ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    try {
      const res = await signup(form);
      alert(res.message || "ÌöåÏõêÍ∞ÄÏûÖ ÏôÑÎ£å!");
      // ÌïÑÏöîÌïòÎ©¥ Ïó¨Í∏∞ÏÑú Î°úÍ∑∏Ïù∏ ÌéòÏù¥ÏßÄÎ°ú Ïù¥Îèô
      // navigate("/login");
    } catch (err) {
      console.error(err);
      alert(err.message || "ÌöåÏõêÍ∞ÄÏûÖ Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.");
    }
  };

  // ------------------------------------
  // 6. Î†åÎçîÎßÅ (ÎîîÏûêÏù∏)
  // ------------------------------------
  return (
    <div className="auth-wrapper">
      <div className="auth-card">
        {/* üîô Îí§Î°ú Í∞ÄÍ∏∞ Î≤ÑÌäº */}
        <button
          type="button"
          className="back-btn"
          onClick={() => navigate("/")}
        >
          ‚Üê Î©îÏù∏ÏúºÎ°ú
        </button>

        <h1 className="auth-title">ÌôòÏòÅÌï©ÎãàÎã§</h1>
        <p className="auth-subtitle">ÏÉà Í≥ÑÏ†ïÏùÑ ÎßåÎì§Ïñ¥ ÏãúÏûëÌïòÏÑ∏Ïöî</p>

        <div className="auth-section-title">ÌöåÏõêÍ∞ÄÏûÖ</div>
        <p className="auth-section-desc">
          Í≥ÑÏ†ï Ï†ïÎ≥¥Î•º ÏûÖÎ†•ÌïòÏó¨ ÌöåÏõêÍ∞ÄÏûÖÏùÑ ÏßÑÌñâÌï¥Ï£ºÏÑ∏Ïöî.
        </p>

        {/* Ïù¥Î¶Ñ */}
        <div className="form-group">
          <label className="form-label">Ïù¥Î¶Ñ</label>
          <div className="input-wrapper">
            <span className="input-icon">üë§</span>
            <input
              name="user_name"
              className="auth-input"
              placeholder="ÌôçÍ∏∏Îèô"
              value={form.user_name}
              onChange={handleInputChange}
            />
          </div>
        </div>

        {/* ÏïÑÏù¥Îîî */}
        <div className="form-group">
          <label className="form-label">ÏïÑÏù¥Îîî</label>
          <div className="input-wrapper">
            <span className="input-icon">üîñ</span>
            <input
              name="user_id"
              className="auth-input"
              placeholder="ÏÇ¨Ïö©Ïûê ÏïÑÏù¥Îîî"
              value={form.user_id}
              onChange={handleInputChange}
            />
          </div>
        </div>

        {/* ÎπÑÎ∞ÄÎ≤àÌò∏ */}
        <div className="form-group">
          <label className="form-label">ÎπÑÎ∞ÄÎ≤àÌò∏</label>
          <div className="input-wrapper">
            <span className="input-icon">üîí</span>
            <input
              type="password"
              name="password"
              className="auth-input"
              placeholder="8Ïûê Ïù¥ÏÉÅ"
              value={form.password}
              onChange={handleInputChange}
          />
          </div>
        </div>

        {/* ÎãâÎÑ§ÏûÑ */}
        <div className="form-group">
          <label className="form-label">ÎãâÎÑ§ÏûÑ</label>
          <div className="input-wrapper">
            <span className="input-icon">üè∑</span>
            <input
              name="user_nickname"
              className="auth-input"
              placeholder="ÎãâÎÑ§ÏûÑ"
              value={form.user_nickname}
              onChange={handleInputChange}
            />
          </div>
        </div>

        {/* Ïù¥Î©îÏùº + Ïù∏Ï¶ùÎ≤àÌò∏ Î∞úÏÜ° */}
        <div className="form-group">
